import './App.css';
import './Logo.png';
import { BrowserRouter as Router, Route, Routes, Link} from 'react-router-dom';


function App() {
  function Home(){
    return <h2> Home </h2>;
  }

  function About(){
    return <h2> About </h2>;
  }

  function Contact(){
    return <h2> Contact </h2>;
  }
  return (


      <div className="App">
        <Router>
        <nav>
          <ul className = "horizontal-list">
            <li><a href = "/"> Home </a></li>
            <li><a href = "/about"> About </a></li>
            <li><a href = "/contact">Contact</a></li>
          </ul>
        </nav>

       <Routes>
       <Route path = "/" Component={Home} />
       <Route path = "/about" Component={About}/>
       <Route path = "/contact" Component={Contact}/>
       </Routes>
       <img src = "/port.jpg" />
       <h1> Hi My name is Nyi Htet</h1>
       <p class = "first-paragraph">
        I am an aspiring software engineering who wants to pursue a career in tech
       </p>
       </Router>
       <ul className = "horizontal-list">
        <li>
        <a href = "https://www.linkedin.com/feed/" target = "_blank"> 
       <img src = "Logo.png" style = {{width: '100px'}} alt = "LinkedIn Logo"/>
       </a>
        </li>
        <li>
        <a href = "https://github.com/NyiHtett" target = "_blank"> 
       <img src = "Logo.png" style = {{width: '100px'}} alt = "Github profile"/>
       </a>
        </li>
        <li>
          <a href="mailto:nyihtet4dev@icloud.com"> Send Email</a>
        </li>
       </ul>

    </div>



  );
}

export default App;
